const LoraRegular = `@font-face { font-family: 'Lora'; font-style: normal; font-weight: 400; src: local('Lora Regular'), local('Lora-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const LoraItalic = `@font-face { font-family: 'Lora'; font-style: italic; font-weight: 400; src: local('Lora Italic'), local('Lora-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Lora700 = `@font-face { font-family: 'Lora'; font-style: normal; font-weight: 700; src: local('Lora Bold'), local('Lora-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
